const useStyles = makeStyles({
  root: {
    display:flex

  },
});

const FilterBar = props => {
  const classes = useStyles()

  return (
    <AppBar className={classes.root} position="static">
      <Toolbar>
        <h3>Filters</h3>
        <Button variant="contained" color="secondary">
          Specialty
        </Button>
        <Button variant="contained" color="secondary">
          Distance
        </Button>
        <Button variant="contained" color="secondary">
          Price
        </Button>
      </Toolbar>
    </AppBar>
  )
}

export default FilterBar
